import * as React from "react";
import { Admin, Resource, ListGuesser, fetchUtils } from 'react-admin';
import jsonServerProvider from 'ra-data-json-server';
import simpleRestProvider from 'ra-data-simple-rest';

import { PostList } from './posts';

const fetchJson = (url, options = {}) => {
    if (!options.headers) {
        options.headers = new Headers({ Accept: 'application/json' });
        options.user = {
            authenticated: true,
            token: 'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjo3LCJ1c2VybmFtZSI6Imx5dGljYSIsImV4cCI6MTYzNzQ2MjIzNywiZW1haWwiOiJhZG1pbkBseXRpY2EuYWkiLCJvcmlnX2lhdCI6MTYzNzM3NTgzN30.hv0N4MO18bfi2SKm6IK4u-UcPQxeQpSMfZEIRWhbXS8'
        };
    }
    // add your own headers here
    options.headers.set('X-Custom-Header', 'foobar');
    return fetchUtils.fetchJson(url, options);
}

const dataProvider = jsonServerProvider('https://staging.vico.ai/analytics', fetchJson);
const App = () => (
    <Admin dataProvider={dataProvider}>
         <Resource name="stores" list={PostList} />
    </Admin>
);


export default App;
